import React from "react";
import image1 from "./Images/Group 23.png";
import image2 from "./Images/Group 3.png";


const Header=()=>{
    return(
        <React.Fragment>
            <header>
                <div className="foto1">
                    <img src={image1}/>
                </div>
                <div className="header-p">Fullstack<br/>веб-разработчик</div>
                <div className="skills"><span>HTML</span> <span>CSS</span> <span>Javascript</span>
                    <span>Typescript</span> <span>React JS</span> <span>Node JS</span>
                    <span>Express JS</span><span>MongoDB</span> <span>Mongoose JS</span></div>
                <a href="">
                    <button>Начать онлайн курс бесплатно</button>
                </a>
                <div className="header-right">
                    <img src={image2}/>
                </div>
            </header>
        </React.Fragment>
    );
}
export  default Header;
